import React from 'react';

const Home = () => {
    return(
        <div className='Home-Container'>
            <h1 className='Home-Title'>NOTHING IS IMPOSSIBLE</h1>
            <h4 className='Home-SubTitle'>In the footwear business since yesterday.</h4>
            <button>EXPLORE NOW</button>
        </div>
    )
}

export default Home;
